    "description": "Fans af Daisy Goodwin, Julian Fellowes og Agatha Christie vil elske denne serie om Mitfordmordene, der er bygget på virkelige forbrydelser og skildrer den virkelige Mitford-familie og dens seks excentriske søstre.\r\n<br>\r\nÅret er 1920 og Louisa Cannon drømmer om en vej ud af fattigdommens London, en by, der er hårdt mærket af den netop overståede verdenskrigs rædsler.\r\n<br>\r\nLouisas redning bliver en ansættelse hos familien Mitford på Asthall Manor i Oxfordshire. Som kombineret barnepige og selskabsdame for de seks Mitfordsøstre får hun adgang til en helt ny og fortryllende verden. Især knytter hun sig til den eventyrlystne og smukke sekstenårige Nancy, den ældste af søstrene, der elsker detektivhistorier og brænder for at opleve verden uden for godset. \r\n<br>\r\nMen da sygeplejersken Florence Nightingale Shore, der er guddatter til sin berømte navnesøster, myrdes på toget til Hastings, husker Louisa, at hun har set noget i det tog, der måske kunne være af betydning. Sagen vækker opsigt, og snart vikles både Louisa og Nancy ind i en mordgåde, der er lige så spændende, som den er livsfarlig.",
